import { css } from '@emotion/css'
const color = 'white'
function Header() {
    // Declare a new state variable, which we'll call "count"

    return (
        <div>
            <div className={css`
                padding: 32px;
                background-color: hotpink;
                font-size: 24px;
                border-radius: 4px;
                &:hover {
                    color: ${color};
                }
            `}>
                <h1>Kanban Board</h1>
            </div>
        </div>
    );
}
